import React from 'react';
import {Link} from "react-router-dom";
import './style.scss';

const Sidebar = () => {
	return (
		<div className="sidebar">
			<div className="logo">
				Justice
				<span className="logo-icon">Crm</span>
			</div>
			<div className="navigation">
				<Link to="/">
					<img src="src/assets/images/icons/home.svg" alt=""/>
					Main page</Link>
				<Link to="/products">My products</Link>
				<Link to="/sales">My sales</Link>
				<Link to="/cabinet">Personal Cabinet</Link>
			</div>
		</div>
	);
};

export default Sidebar;
